import React, { Component } from 'react';
import { Layout, Button } from 'antd';
import Timeline from './Timeline';
import { logout, getUser } from '../authentication';
import { history } from '../History';
import PrimarySearchAppBar from './Appbar';
import Home from './Home';
import { Route, Switch } from "react-router-dom";


import './Main.css';

const { Header, Footer, Content } = Layout;

class Main extends Component {

    logOut = () => {
        logout()
        history.push('/login')
    }

    goHome = () => {
        history.push('/home')
    }

    render() {
        return (
            <div>
                <Layout>
                    <PrimarySearchAppBar />
                    <Content>
                        <Button type="danger" onClick={this.logOut} >로그아웃</Button>
                        <Button type="primary" onClick={this.goHome} >home</Button>

                        <Switch>
                            <Route path='/main' exact component={Timeline} />
                            <Route path='/home/:userID' exact component={Home} />
                        </Switch>
                    </Content>
                    <Footer>Footer</Footer>
                </Layout>
            </div>
        );
    }
}

export default Main;
